import React from 'react';

import { Container, FormContainer, RegisterForm } from './styles';
import FormGroup from '../../Components/Form-Group'


function Cadastro() {
  return (
    <Container>
        <FormContainer>
            <RegisterForm>
                <FormGroup label="Login" /> 
            </RegisterForm>
        </FormContainer>
    </Container>
  )
}

export default Cadastro;
